INSERT WQL Reference Inserts a HashMap<String, Types > into the entity tree key previously created (my_entity_name). This request returns a Uuid containing the entity id. Example request: 'INSERT {a: 123, c: \"hello\", d: \"world\",} INTO my_entity_name' Example response: ( entity: "my_entity_name", uuid: "00d025c9-eda8-4190-a33a-29998bd77bd3", message: "Entity my_entity_name inserted with Uuid 00d025c9-eda8-4190-a33a-29998bd77bd3",
) The request above will insert an entity with the following structure in my_entity_name: {"my_entity_name": { Uuid(00d025c9-eda8-4190-a33a-29998bd77bd3): {a: 123, c: "hello", d: "world",},
}}
